import App from "./app";

function Home() {
  return (
    <App>
      <div className="banner">
        <div className="banner-image">
          <img
            src="https://my-unique-ecommerce-v2.s3.eu-north-1.amazonaws.com/shoes/banner.jpg"
            alt="banner"
          />
        </div>
        <div className="banner-content"></div>
      </div>
      <main></main>
    </App>
  );
}

export default Home;
